import HeaderBar from "../Component/HeaderBar/HeaderBar";
import DashBoard from "./DashBoard/DashBoard";
import "rsuite/dist/rsuite.min.css";
import puppeteer from "puppeteer";
// import IndicesScrape from "./../Scrapers/indicesScraper"
function App() {

  async function IndicesScrape(url) {
    const browser = await puppeteer.launch();
    const page = await browser.newPage();
    await page.goto(url);
    const [el] = await page.$x('//*[@id="liveindexTable"]/tbody');
    console.log(el)
  }
  IndicesScrape("https://www.nseindia.com/market-data/live-market-indices")
  return (
    <div className="App">
      <HeaderBar />
      <DashBoard />
    </div>
  );
}

export default App;
